import Navbar from "./Navbar";

export default function AppLayout({ children }) {
  return (
    <div>
      <Navbar />
      <div style={{ maxWidth: 1000, margin: "0 auto", padding: "18px 16px" }}>
        {children}
      </div>
    </div>
  );
}
